comments:
Queen Victoria had thoughts on this too;
Were women to "unsex" themselves by claiming equality with men, they would become the most hateful, heathen, and disgusting of beings and would surely perish without male protection.
Queen Victoria||''she donated the equivalent of roughly £200,000 in today’s money to the Irish''.....no evidence ever produced another Brit Myth||Ludicrous. Those voters would have chosen Trump even if Hillary were a man. And the queen? What does a woman born with a golden spoon have anything to do with it?||Julia Baird is a terrific journalist and broadcaster - she brings intelligence and wit to her role as host of The Drum. I even forgive her for being from a Liberal Party family :)||What an empowering and inspiring story for women around the world - how a girl born a mere 'princess' rose to become Queen of England!

